import React, { Component } from "react";
import { Link } from "react-router-dom";
import _ from "lodash";
class Welcome extends Component {
  render() {
    const name = _.startCase(_.camelCase(this.props.name));

    return (
      <div>
        <div className="alert alert-success" role="alert">
          <h4 className="alert-heading">Hey {name} ,</h4>
          <p>
            You haven't posted anything so far. Shall we get started ?
          </p>
          <hr />
          <p className="mb-0">
            Save, share your beatiful moments so that you cherish later.
            <br /><br />
            <button type="button" class="btn btn-info">POST</button>
          </p>
        </div>
      </div>
    );
  }
}
export default Welcome;
